import React from 'react';
import './AboutUs.css'; // Import the CSS file for styling

// About Us component with a video section
const AboutUs = () => {
  return (
    <div className="about-us-container">
      <h1>About Us</h1>
      <p>
        Welcome to our farm data management platform, where we provide real-time insights and sensor data.
      </p>

      {/* Video Section */}
      <div className="video-container">
        <video className="background-video" controls autoPlay loop muted>
          <source src="/images/2758322-uhd_3840_2160_30fps.mp4" type="video/mp4" />
          Your browser does not support the video tag.
        </video>
      </div>
    </div>
  );
};

export default AboutUs;
